import React, { useState } from 'react'

const WikiSearch = () => {
    const [term, setTerm] = useState('');
    return (
        <div className="m-20">
            <div className='ui form'>
                <div className='field'>
                    <label><span className='color-yellow greet'>Search: </span></label>
                    <input 
                        value={term} 
                        onChange={e => setTerm(e.target.value)}
                        className='input'
                    />
                </div>
            </div>
        </div>
    )
};

export default WikiSearch;
